1. Key psychological mechanisms: In responder decisions, fairness perception plays a major role. Responders compare the monetary share they are offered with a “fair” amount based on their relative contribution measured by token counts. In addition, a baseline bias in willingness to accept is also likely.
2. Mechanism interaction: The offered share (split_self) is compared with the fair share determined by the ratio token_self/(token_self + token_opp) multiplied by the combined pot (combined_earning). A deviation from this fair share is then weighted by a sensitivity parameter; added to a baseline bias produces a utility value.
3. Mathematical form: The model computes a utility value as a linear function of the fairness deviation (split_self minus expected fair share). This utility is then transformed using a logistic function to yield a probability of acceptance.
4. Parameters: Two learnable parameters are used:
   • bias (intercept) capturing baseline willingness (with a generous bound).
   • fairness_sensitivity capturing responsiveness to fairness deviations (with a generous symmetric bound).
5. Mapping to observable behavior: The computed utility (and its logistic transform) directly predicts the binary choice "accept". When U < 0, the probability of acceptance is below 50%, fulfilling the specified condition.

The formal model and variable specification are provided below.

<MODEL>
U = bias + fairness_sensitivity * (split_self - (combined_earning * token_self / (token_self + token_opp)))
P_accept = 1 / (1 + exp(-U))
