def simulate_model(trial_data, bias=0, fairness_sensitivity=0):
    model_predictions = []
    for trial in trial_data:
        token_self = trial.get("token_self", 0)
        token_opp = trial.get("token_opp", 0)
        combined_earning = trial.get("combined_earning", 0)
        split_self = trial.get("split_self", 0)

        if (token_self + token_opp) == 0:
            fair_share = combined_earning * 0.5  # default to equal split if no tokens
        else:
            fair_share = combined_earning * token_self / (token_self + token_opp)

        U = bias + fairness_sensitivity * (split_self - fair_share)
        try:
            P_accept = 1 / (1 + math.exp(-U))
        except OverflowError:  # Handle potential overflow in exp(-U)
            if U > 0:
                P_accept = 0.0
            else:
                P_accept = 1.0

        model_predictions.append(P_accept)
    return model_predictions
